import React from 'react'
import "./ExpenseItem.scss";

export default function ExpenseItem() {
  const date = new Date();
  const title = ''
  return (
    <div className="expense-item">
      <div>{date}</div>
      <div className="expense-item__description">
        <h2></h2>
        <div className="expense-item__price">$399</div>
      </div>
    </div>
  )
}
